import React from 'react';

const Footer = (props) => {
    var dueToday = []; props.data.filter(data => {
        if (
          new Date(data.dueDate).toLocaleDateString() ===
          new Date().toLocaleDateString()
        ) {
          dueToday.push(data);
        }
    })
    return (
        <div className="footerApp">
            {props.label}
        </div>
    );
};


export default Footer;
